                    "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\n\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p>Fenômenos físicos e químicos são&nbsp;transformações que ocorrem na matéria, mas se diferenciam pela forma como ela se apresenta antes e depois do processo.</p></div>\n\t\t\n\t\t<div  style=\"padding-bottom: 12px;\" class=\"ng-scope\"></div>\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p>Qual é a diferença entre fenômenos físicos e químicos?</p></div>\n\t</div>",
